import React,{useState} from 'react'

const Todo = () => {

    const [name, setname] = useState('shubham')
    const onchangeinput =()=>{
        if (name == "shubham") {
            setname("chaudhari")
        }
        else{
            setname("shubham")
        }
    }

    return (
        <>

            <h1>{name}</h1>
            <button onClick={onchangeinput}>click me</button>
        </>
    )
}

export default Todo
